	(24, 'Bàn phím cơ Gaming Leaven K550 Blue Switch TKL 87 phím , LED Rainbow ', '🔥 BÀN PHÍM CƠ GAMING LEAVEN K550 BLUE SWITCH\n\n- Là mẫu bàn phím TKL với 87 phím cơ , sử dụng trục cơ khí Blue Switch\n\n- LED sử dụng là LED Rainbow phân vùng đồng thời phím là dạng LED xuyên kết hợp với 9 chế độ LED khác nhau\n\n- Mặt phím sử dụng công nghệ khắc Laser chống phai màu\n\n- Trục phím cơ Blue Switch 1 trong những loại phím cơ tốt nhất trên thị trường, cho hành trình phím , âm phím cũng như trải nghiệm sử tốt nhất\n\n- Thiết kế phím là dạng công thái học , với mặt phím từ thấp lên cao giúp người dùng dễ làm quen với phím và sẽ không bị mỏi khi làm việc trong thời gian dài\n\n- Dạng phím là Double Short giúp bạn dễ dàng tháo , độ phím cũng như vệ sinh phím 1 cách dễ dàng\n\n- Tính năng ấn tượng nhất trên phím là khả năng chống nước chống bụi \n\n- Toàn bộ phím được làm bằng nhựa ABS có độ bền cao giúp tổng trọng lượng phím chỉ khoảng 600-800 gram giúp bạn dễ dàng mang theo khi đi xa.\nThông số chi tiết :\n\n- Model: K550\n\n- Kiểu phím : TKL 87 phím\n\n- Kích thước: 360x130x36 (mm)\n\n- Màu sắc: Đen, Trắng\n\n- Hiệu ứng ánh sáng: 9 Hiệu ứng \n\n- Giao diện: cáp USB với cục chống nhiễu\n\n- Chiều dài dây: 1.8m/5,91ft\n\n- Loại switch: Blue switch\n\n- Khả năng tương thích hệ thống: Dành cho win xp/7/8/10, mac 10.2 trở lên\n\n- Trục phím cơ : Blue switch\n\n- Chống nước , bụi : Có\n\n- LED : Rainbow phân vùng , xuyên phím\n\n- Chất liệu : Nhựa ABS\n\n- Dạng Phím : Double short\n\n\n\n\n\n❌  KINH NGHIỆM SỬ DỤNG VÀ BẢO QUẢN BÀN PHÍM CƠ BẠN NÊN BIẾT:  \n\n- Dùng những chiếc khăn mềm và ẩm để lau toàn bộ các phím. Hoặc bạn cũng có thể dùng khăn khô thấm cồn 90 độ để đồng thời diệt khuẩn \n\n- Dùng một chiếc cọ mềm và quét sạch mọi ngóc ngách tại đó. Bạn cũng có thể dùng 1 bình xịt khí nén để thổi bụi bẩn ra khỏi các khe\n\n- Lưu ý bạn nên úp mặt bàn phím cơ xuống rồi tháo các vít ở các góc và vị trí có dấu mũi tên. Sau đó, bạn lật mặt sau của bàn phím cơ, lấy bản mạch ra, rồi tháo rời các phím. \n\n\n\n** Quyền lợi khi mua hàng tại Smart New\n\n- Bảo hành toàn quốc tại các trung tâm ở Hà Nội và Hồ Chí Minh\n\n\n\n- Đơn vị sản xuất và lắp ráp: Jangjun Technology Co., Ltd\n\n- Địa chỉ : 370 Xiangshan Avenue, Luotian Community, Yanluo Street, Baoan District, Shenzhen\n\n- Xuất xứ : Trung Quốc\n\n- Đơn vị nhập khẩu và phân phối: Trung tâm phân phối thiết bị số SMART NEW\n\n- Đại chỉ bảo hành: \n\n+ Tại Hà Nội : Building SMART NEW 27/176 Mai Dịch Cầu Giấy Hà Nội \n\n+ Tại HCM : 27/32 đường số 8 Linh Xuân Thủ Đức\n\n+ Sản phẩm bảo hành 1 đổi 1 trong 30 ngày\n\n\n\n #gaming #banphim #banphimco #banphimgame #banphimmaytinh #banphimgiaco #banphimcogaming #banphimgaming #maytinh #phukienmaytinh #pc #smartnewvn #smartnew #k550', 'Leaven', 'http://res.cloudinary.com/nguyenkien2022001/image/upload/v1671212705/upload/svtyq15dlf7khkrutyri.jpg', 2, ' Là mẫu bàn phím TKL với 87 phím cơ , sử dụng trục cơ khí Blue Switch', 499000, 'banphim, banphimco, leaven', 'Mới 99%', 319, '2022-12-17 00:45:18', '2022-12-17 00:45:18', '2022-12-17 00:45:18'),
